E}\" \"${PRODUCT_DIR}/${PROJECT_NAME}-${TARGET_PLATFORM}.framework\"\n\n    # Build for another platform\n    xcrun xcodebuild -workspace \"${SRCROOT}/${PROJECT_NAME}.xcworkspace\" -scheme \"${TARGET_NAME}\" -configuration \"${CONFIGURATION}\" -sdk ${SCRIPT_DEFINED_SDK_NAME} BUILD_DIR=\"${BUILD_DIR}\" OBJROOT=\"${OBJROOT}\" BUILD_ROOT=\"${BUILD_ROOT}\" SYMROOT=\"${SYMROOT}\" $ACTION\n\n    # Copy PubNub framework build results to product directory.\n    /bin/cp -R \"${SCRIPT_DEFINED_TARGET_PATH}/${FRAMEWORK_FILE_NAME}\" \"${PRODUCT_DIR}\"\n\n    # Rename compiled for secondary target framework.\n    /bin/mv \"${PRODUCT_DIR}/${FRAMEWORK_FILE_NAME}\" \"${PRODUCT_DIR}/${PROJECT_NAME}-${SCRIPT_DEFINED_TARGET}.framework\"\n\n    /bin/cp -R \"${PRODUCT_DIR}/${PROJECT_NAME}-${TARGET_PLATFORM}.framework\" \"${PRODUCT_DIR}/${FRAMEWORK_FILE_NAME}\"\n    /bin/rm \"${PRODUCT_DIR}/${FRAMEWORK_FILE_NAME}/${PROJECT_NAME}\"\n\n    # Create fat binary using lipo and store it inside of original target .framework (created previously by static library post-build script).\n    xcrun lipo -create \"${PRODUCT_DIR}/${PROJECT_NAME}-${TARGET_PLATFORM}.framework/${PROJECT_NAME}\" \"${PRODUCT_DIR}/${PROJECT_NAME}-${SCRIPT_DEFINED_TARGET}.framework/${PROJECT_NAME}\" -output \"${PRODUCT_DIR}/${FRAMEWORK_FILE_NAME}/${PROJECT_NAME}\"\nfi";
